import React from "react";
import s from "./Card.module.css";

export default function Card({ header, text, link, extraClass }) {
  return (
    <div className={extraClass}>
      <p className={s.CardHeader}>{header}</p>
      {text}
      {"\n"}
      {link}
    </div>
  );
}
